    Xbo_metc13 = x[7] * p[77]  # [30] Xbo_metc13
    Xbreath_co2c13 = x[8] * p[76]  # [31] Xbreath_co2c13
    Xgu_apap = x[9] * p[75]  # [32] Xgu_apap
